function load(ind)
    map = {}
    all_entities = {}
    local s = LEVELS[ind]
    local parts = split(s,":")
    minx, maxx, minz, maxz, LEVEL_PALETTE, level_name, level_start = unpack(split(parts[1],"/"))
    local ts = parts[2]
    local i = 0
    local numzs = maxz - minz + 1
    for t in all(split(ts, ";", false)) do
        local z = (i % numzs) + minz
        local x = (i \ numzs) + minx    
        if #t > 0 then

            local parts = split(t, ",")
            
            if parts then
                add_map_tile(x, z, parts[1], parts[2], parts[3] == 1, parts[4] == 1, parts[5])
            end
        end
        i += 1
    end
end

